import './componentcss.css';

class dataPrint extends React.Component {
    constructor() {
        super();
        this.state = {
           data: "hah"
        }
        this.handleClick = this.handleClick.bind(this);
     }
     handleClick(){
        this.setState({data:"asdasdasd"});
        alert("sdsfsdfsd");
      }

    render() {

       return (
          <tr className="example1" onclick={this.handleClick}  >
             <td>{this.props.data}</td>

          </tr>
       );
    }
 }



